import React from "react";
import { keyGoogle } from "./APIkeys";

export default function EditArray({address}){
  const url =`https://maps.googleapis.com/maps/api/staticmap?center=${address}&zoom=16&size=400x400&key=${keyGoogle}`;
  return (
    <div className="roof-editor">
      <img src={url} alt='map'/>
    </div>
  )
}
